import {TokenData} from "./oauthAPI";
import axios from "axios";

export const getUser=async (tokenData: TokenData) => {
    const url = 'http://localhost:8080/authAPI/v1/user/'+ tokenData.email
    return await axios.get('http://localhost:8080/userAPI/v1/user/', {headers: {
            'Email': tokenData.email,
            'Provider': tokenData.provider,
            'Token': tokenData.token
    }})
}
